import Row from "react-bootstrap/esm/Row";
import Col from "react-bootstrap/esm/Col";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faPhone } from '@fortawesome/free-solid-svg-icons';
function manage(){
 return(
<div className="pb-5 " id="section5">
   <h3><u >Our Team</u></h3>
    <Row>      
      <Col></Col>
      <Col>
        <h4 className="text-dark"> Mohan Velaga</h4>
        <p>Operational Manager India</p>
        
       <p> <FontAwesomeIcon icon={faPhone}/> +916301096203</p>
      
       <a href="h"> <FontAwesomeIcon icon={faEnvelope} />mail </a>  
      </Col>
      <Col >
        <h4 className="text-dark"> Thanuja Pilla</h4>
        <p>Operational Manager US</p>
        <p> <FontAwesomeIcon icon={faPhone}   /> +916301096203</p>
      
       <a href="h"> <FontAwesomeIcon icon={faEnvelope}   />mail </a>
      </Col>
      <Col></Col>
    </Row>
</div>

 )
};
 export default manage;
